import React,{ useState , useEffect} from 'react'

function OthersBookings() {

    const [formDetail,setFormDetail]=useState([]);
    const [error,setError]=useState("");
     
    useEffect(()=>{
            const getAllDetails=async()=>{
                try{
                    const response=await fetch("http://localhost:5000/api/bookings/bookingdetailByMember",{
                      method: "POST",
                      body: JSON.stringify({
                        member: "OTHERS",
                      }),
                      headers: {
                        'Content-Type': 'application/json'
                      }
                });
                    const responseData = await response.json();
                    if (!response.ok) {
                        throw new Error(responseData.message);
                      }
                      else {
                        setFormDetail(responseData.bookingDetail);
                        console.log(responseData.bookingDetail);
                      }
                }catch(err){
                    setError(err.message);
                    console.log(err.message);
                }
            };

            getAllDetails();


    },[]);

  return (
    <div>
         {error && <p style={{marginLeft: "35px"}}>{error}</p>}
         <table style={{marginLeft: "60px"}} className="table">
          <thead className="thead">
            <tr>
              <th>Name</th>
              <th>Post</th>
              <th>Id</th>
              <th>Current City</th>
              <th>Current District</th>
              <th>Current State</th>
              <th>Current Pincode</th>
              <th>Mobile No</th>
              <th>Purpose</th>
              <th>Start Date</th>
              <th>End Date</th>
              <th>Floor</th>
            </tr>
          </thead>
          <tbody className="tbody">
            {formDetail.map((applicant, index) => (
              <tr key={parseInt(index)}>
                <td>{applicant.name}</td>
                <td>{applicant.post}</td>
                <td>{applicant.id}</td>
                <td>{applicant.city}</td>
                <td>{applicant.district}</td>
                <td>{applicant.state}</td>
                <td>{applicant.pincode}</td>
                <td>{applicant.mobile}</td>
                <td>{applicant.purpose}</td>
                <td>{applicant.startDate}</td>
                <td>{applicant.endDate}</td>
                <td>{applicant.floor}</td>
              </tr>
            ))}
          </tbody>
        </table>
    </div>
  )
}

export default OthersBookings;
